import React from 'react'

const Counter = () => {
  const [init, setCount] = React.useState(0)
  return (
    <div>
    <h2>contador{init}</h2>

      <button type="button" class="btn btn-warning " onClick={()=>{ setCount(init + 1)}}>+</button>
      <button type="button" class="btn btn-danger" onClick={()=>{ setCount(init + 1)}}>-</button>
    </div>
  )
}

export default Counter
